import React from "react";

const Topbar = (props) => {
    let goBack= <React.Fragment/>;
    let selectView= <React.Fragment/>;
    if(props.enter){
        goBack= <button className="back" onClick= {()=>props.back()}> BACK </button>;
        selectView= 
        <select>
            <option > Day </option>
            <option > Week </option>
            <option > Month </option>
        </select>
    } 
    return (
        <div className="header">
            {goBack}
            <div className="headerFont">
                <div className="oneLine">
                    <input
                        placeholder="Search Teacher ðŸ”Ž"
                        className="input"
                        type="text"
                        onChange={props.textChange}
                    />
                </div>
            </div>
        </div>
    );
};

export default Topbar;
